svg.script:
           debug = true

           SVGDocument = null

           Row1 = null
           Row2 = null
           Row3 = null

           Rhythm1 = null
           Rhythm2 = null
           Rhythm3 = null

	       LS  = null
           RS  = null
		   DOT = null
		   AllLeft = null

      	   function Initialize(LoadEvent)
      	   {
               SVGDocument = LoadEvent.getTarget().getOwnerDocument()
               incr = 2;

               filtertext = SVGDocument.getElementById("filtertext");
               filterbox = SVGDocument.getElementById("filterbox");
               charlengthfilter = filtertext.getComputedTextLength();
               FilterBoxPath = "M " + (2600-charlengthfilter) + " " + (2100) + " " + "H " + (2600) + " V " + (2150) + " H " + (2600-charlengthfilter) + " V " + (2100);
               filterbox.setAttribute("d", FilterBoxPath);

               AllLeft = SVGDocument.getElementById("leftstatementSegment");
               if (AllLeft != null)
               {
			      cnt = AllLeft.getAttribute("count");
               }


			   for (i = 1; i < 20; i++)
			   {
				  dot = "Dot" + i
				  DOT = SVGDocument.getElementById(dot);
				  if (DOT != null)
				  {
					 ls = "ls" + i + "dot" + 0
					 LS = SVGDocument.getElementById(ls);
					 if (LS != null)
					 {
				         rs = "rs" + i + "dot" + 0
					     RS = SVGDocument.getElementById(rs)
					     if (RS != null)
					     {
						    charLength1 = LS.getComputedTextLength()
							charLength2 = RS.getComputedTextLength()
							yVal = LS.getAttribute("y")
							PathData1 = "M " + (charLength1) + " " + yVal + " " + "H " + (2000-charLength2-275)
							DOT.setAttribute("d", PathData1)
					     }
					 }

				  }
			   }

           }
